import Header from "../components/Header";
import { useState } from "react";
import Main from "../components/Main";
import TextInput from "../components/TextInput";
import DateInput from "../components/DateInput";
import { data } from "../data";
export default function App() {
  console.log("Teste no console do navegador");
  const [name, setName] = useState("");

  function handleNameChange(newName) {
    setName(newName);
  }
  const [birthday, setAdress] = useState("");
  function handlebirthdayChange(newBirthday) {
    setAdress(newBirthday);
  }
  console.log(data);
  return (
    <>
      <Header>React Investiments</Header>
      <Main>
        <div>
          <h2 className="text-left">Relatório de Investimentos</h2>
        </div>
        <TextInput
          id="textInput"
          labelDescription="Digite o seu nome:"
          inputValue={name}
          onInputChange={handleNameChange}
        />
        <DateInput
          id="dateInput"
          labelDescription="Data de Nascimento:"
          inputValue={birthday}
          onInputChange={handlebirthdayChange}
        />
        <p>
          Seu nome é {name}, com {name.length} caracteres e você possui 38 anos.
        </p>
      </Main>
    </>
  );
}
